--1.CREATE BANK TABLE AND INSERT 100 RECORDS.
create table bank (
id INT PRIMARY KEY,
    name VARCHAR(255) NOT NULL,
    address VARCHAR(255) NOT NULL,
    email VARCHAR(255) UNIQUE,
    ifsc_code VARCHAR(255),
    branch VARCHAR(255),
    fund DECIMAL(10, 2) DEFAULT 0,
    UNIQUE(ifsc_code, branch)
)


