--2.CREATE EMPLOYEE TABLE AND INSERT 2000 RECORDS.

CREATE TYPE position_type_enum AS ENUM('Manager', 'Teller', 'Accountant', 'Clerk', 'Security');

create table emp(
id INT PRIMARY KEY,
    bank_id INT,
    first_name VARCHAR(255) NOT NULL,
    last_name VARCHAR(255) NOT NULL,
    email VARCHAR(255) UNIQUE,
    phone_number VARCHAR(20),
    address VARCHAR(255),
    city VARCHAR(255),
    state VARCHAR(255),
    zip_code VARCHAR(10),
    position position_type_enum,
    salary DECIMAL(10, 2),
    hire_date DATE,
    FOREIGN KEY (bank_id) REFERENCES Bank(id)
)
